import React, {useEffect} from 'react'
import {useParams} from 'react-router-dom';
import axios from 'axios';

function Proizvod() {
    let {id} = useParams();

    useEffect(() => {
        axios.get(`http://localhost:3001/proizvodi/byId/${id}`).then( (response) =>{
            console.log(response);
        })
    })

  return (
    <div>{id}</div>
  )
}

export default Proizvod
